import React from "react";
import { useNavigate } from "react-router-dom";

function Admin() {
  const navigate = useNavigate();
  return (
    <div>
      <h2>後台管理系統</h2>
      <div style={{ display: "flex", flexDirection: "column", gap: 16, marginTop: 32 }}>
        <button style={{ padding: 16, fontSize: 18 }} onClick={() => navigate("/inventory")}>庫存管理</button>
        <button style={{ padding: 16, fontSize: 18 }} onClick={() => navigate("/shipping")}>出貨統計</button>
        <button style={{ padding: 16, fontSize: 18 }}>通路商帳號管理</button>
        <button style={{ padding: 16, fontSize: 18 }}>資料備份/還原</button>
      </div>
      <button onClick={() => {
        localStorage.removeItem("user");
        window.location.reload();
      }} style={{ marginTop: 24, width: 120, background: '#c00', color: '#fff', border: 'none', borderRadius: 6, padding: 8 }}>
        登出
      </button>
    </div>
  );
}

export default Admin;
